struct Node {
    int push = 0;
    int cc = 0, co = 0, oc = 0, oo = 0;
    int ccc = 0, cco = 0, coc = 0, coo = 0;
};
vector <pair <ld, pair <int, int> > > zxc;

struct SegTree {
    vector <Node> t;
    SegTree(int n) {
        t.resize(4 * n);
    }
    Node emp;
    void build(vector <int>& a, int v, int l, int r) {
        if (l == r) {
            t[v].ccc = 1;
            t[v].cco = 0;
            t[v].coc = 0;
            t[v].coo = 0;
            t[v].cc = a[l];
            t[v].co = 0;
            t[v].oc = 0;
            t[v].oo = 0;
        }
        else {
            int m = (l + r) / 2;
            build(a, 2 * v, l, m);
            build(a, 2 * v + 1, m + 1, r);
            unite(t[2 * v], t[2 * v + 1], t[v]);
        }
    }
    void push(int v) {
        t[v].cc += t[v].push * t[v].ccc;
        t[v].co += t[v].push * t[v].cco;
        t[v].oc += t[v].push * t[v].coc;
        t[v].oo += t[v].push * t[v].coo;
        if (2 * v + 1 < t.size()) {
            t[2 * v].push += t[v].push;
            t[2 * v + 1].push += t[v].push;
        }
        t[v].push = 0;
    }
    void unite(const Node& l, const Node& r, Node& m) {
        zxc.clear();
        //[]
        //zxc.push_back({ l.cc + r.cc / (ld)(l.ccc + r.ccc), {l.cc + r.cc, l.ccc + r.ccc} });
        //sort(allr(zxc));
        m.oo = m.oc = m.co = m.cc = l.cc + r.cc;
        m.coo = m.coc = m.cco = m.ccc = l.ccc + r.ccc;
        //(]
        if (l.coc + r.ccc > 0) {
            if (l.oc + r.cc / (ld)(l.coc + r.ccc) >= m.cc / (ld)m.ccc) {
                m.oc = l.oc + r.cc;
                m.coc = l.coc + r.ccc;
                if (m.coc > 1) {
                    zxc.push_back({ m.oc / (ld)m.coc, {m.oc, m.coc} });
                }
            }
        }
        //[)
        if (l.ccc + r.cco > 0) {
            if (l.cc + r.co / (ld)(l.ccc + r.cco) >= m.cc / (ld)m.ccc) {
                m.co = l.cc + r.co;
                m.cco = l.ccc + r.cco;
                if (m.cco > 1) {
                    zxc.push_back({ m.co / (ld)m.cco, {m.co, m.cco} });
                }
            }
        }
        //()
        //(] + [) or max(),(); 
        if (l.coc + r.cco > 1) {
            zxc.push_back({ l.oc + r.co / (ld)(l.coc + r.cco), {l.oc + r.co, l.coc + r.cco} });
        }
        if (l.coo > 1) {
            zxc.push_back({ l.oo / (ld)l.coo, {l.oo, l.coo} });
        }
        if (l.coc > 1) {
            zxc.push_back({ l.oc / (ld)l.coc, {l.oc, l.coc} });
        }
        if (l.cco > 1) {
            zxc.push_back({ l.co / (ld)l.cco, {l.co, l.cco} });
        }
        if (l.ccc > 1) {
            zxc.push_back({ l.cc / (ld)l.ccc, {l.cc, l.ccc} });
        }
        if (r.coo > 1) {
            zxc.push_back({ r.oo / (ld)r.coo, {r.oo, r.coo} });
        }
        if (r.coc > 1) {
            zxc.push_back({ r.oc / (ld)r.coc, {r.oc, r.coc} });
        }
        if (r.cco > 1) {
            zxc.push_back({ r.co / (ld)r.cco, {r.co, r.cco} });
        }
        if (r.ccc > 1) {
            zxc.push_back({ r.cc / (ld)r.ccc, {r.cc, r.ccc} });
        }
        sort(allr(zxc));
        if (!zxc.empty()) {
            if (zxc[0].first >= m.cc / (ld)m.ccc) {
                m.oo = zxc[0].second.first;
                m.coo = zxc[0].second.second;
            }
        }
    }
    void update(int v, int tl, int tr, int l, int r, int x) {
        push(v);
        if (tr < l || tl > r) {
            return;
        }
        else {
            if (tl >= l && tr <= r) {
                t[v].push += x;
                push(v);
            }
            else {
                int tm = (tl + tr) / 2;
                update(v * 2, tl, tm, l, r, x);
                update(v * 2 + 1, tm + 1, tr, l, r, x);
                unite(t[v * 2], t[v * 2 + 1], t[v]);
            }
        }
    }
    Node query(int v, int tl, int tr, int l, int r) {
        push(v);
        if (tl > r || tr < l) {
            return emp;
        }
        else {
            if (tl >= l && tr <= r) {
                return t[v];
            }
            else {
                int tm = (tl + tr) / 2;
                Node L, R, M;
                L = query(2 * v, tl, tm, l, r);
                R = query(2 * v + 1, tm + 1, tr, l, r);
                unite(L, R, M);
                return M;
            }
        }
    }
};

void solve() {
    int n, q, i, j, l, r, x, act;
    cin >> n >> q;
    vector <int> a(n);
    for (i = 0; i < n; i++) {
        cin >> a[i];
    }
    SegTree tree(n);
    Node res;
    ld best;
    tree.build(a, 1, 0, n - 1);
    while (q--) {
        cin >> act;
        if (act == 2) {
            cin >> l >> r;
            l--, r--;
            res = tree.query(1, 0, n - 1, l, r);
            best = 0;
            if (res.ccc != 1) {
                best = max(best, res.cc / (ld)res.ccc);
            }
            if (res.cco != 1) {
                best = max(best, res.co / (ld)res.cco);
            }
            if (res.coc != 1) {
                best = max(best, res.oc / (ld)res.coc);
            }
            if (res.coo != 1) {
                best = max(best, res.oo / (ld)res.coo);
            }
            cout << fixed << setprecision(12)
                << best << endl;
        }
        else {
            cin >> l >> r >> x;
            l--, r--;
            tree.update(1, 0, n - 1, l, r, x);
        }
    }
}

