/////////////////////////////////////////////////
Cll::Cll()
{
	   pHead	= 0;
	   pTail    = 0;
	   nCounter = 0;	
} 
 
/////////////////////////////////////////////////    destructor
Cll::~Cll()                                    //   
{
	LL* p = pHead;

	while (p != 0)
	{
		p = pHead->pNext;

		free(pHead);

		pHead = p;
	}
} 
 
 
///////////////////////////////////////// * * * * * * * * * * * * * (1) * * * * * * * * * * * * * * //////////////////
int Cll::del_nData(int n)
{
	
	 LL *p = pHead,	        
		*pPrev = 0;
	
	
	
	 while(p != 0)
	 {
			
		if(p->nData == n)
		{
			
		    	
		   if(p == pHead)////////////////////
		   {	
			
			   
			
			  if(nCounter == 1) pHead = 0;
			  else
			             pHead = p->pNext; 
			
			  free(p);
			  nCounter --;
			  
			  return 1;
		   }
		   

		   
		   
		   if(p == pTail)////////////////////
		   {	
			
	          pTail =  pPrev; 
	          pTail -> pNext = 0; 
			
			  free(p);
			  nCounter --;
			  
			  return 2;
		   }
		   		   

			
	          pPrev->pNext = p->pNext; 
	          
			
			  free(p);
			  nCounter --;
			  
			  return 3;		   
		   
		   
		}
		
		pPrev = p;
		        p = p->pNext;	
	 }	


return 0;	
} 
    

/////////////////////////////////
void Cll::testPrintAll()
{
	
	 LL *p = pHead;
	
	 while(p != 0)
	 {
			
	    printf("%d\n", p->nData);		
		
		p = p->pNext;	
	 }	
}


