void Cll::add(int n)
{
	
	
	LL *p = (LL*)malloc(sizeof(LL) );
	
	if(pHead == 0)
	{
		
	   pHead = p;	
		
	}
	else
	{
		
	   pTail->pNext	= p;
		
	}
	
	pTail    = p;
	p->nData = n;
	p->pNext = 0;
	
	nCounter ++;
}




