void scrittura(String messaggio)
{
  int lunghezza=messaggio.length();
  for(int i=0;i<lunghezza;i++){
    lcd.print(messaggio[i]);
    delay(100);}
} 
 
void InviaDatiSeriale()
{
  String label = "Var";
  const byte nValori = 8;
  float var[nValori] = {STATO, lpv, lsv, lsp, temperatura, pressure, altitude};
  for (int i = 0; i < nValori; i++) 
     {
       String stuff = "\n" + label + i + ": ";
       String toSend=stuff+String(var[i]);
       Serial1.write(toSend.c_str());
     }
}  

void duecifre(int digits) //di richiamo al metodo DataOraSeriale
{
  if (digits < 10)
     {
       Serial.print('0');
     }
  Serial.print(digits);
}

void DataOraSeriale()
{   
  Serial.print(DayOfWeek[weekday()-1]);
  Serial.print(" ");
  duecifre(day());
  Serial.print('/');
  duecifre(month());
  Serial.print('/');
  Serial.print(year());
  Serial.print("  ");
  duecifre(hour());
  Serial.print(':');
  duecifre(minute());
  Serial.print(':');
  duecifre(second());
  Serial.println();    
}
 
void TempRtcLCD() 
{  
  lcd.setCursor(0,1);
  lcd.print(myRTC.temperature()/4.); lcd.print(" C"); //sensore temperatura RTC/4
  lcd.setCursor(13,1);
  lcd.print(temperatura,2.); lcd.print(" C");       //sensore temperatura MPL3115
}
 
void StatoLCD()
{
  lcd.setCursor(12,3);
  lcd.print("P "); lcd.print(lpv);
  lcd.setCursor(16,3);
  lcd.print("S "); lcd.print(lsv); lcd.print(lsp);
  lcd.setCursor(0,3);
  lcd.print("EVI="); lcd.print(evi);
  lcd.setCursor(6,3);
  lcd.print("EVU="); lcd.print(evu);
  lcd.setCursor(0,2);
  //lcd.print("AVVIO="); lcd.print(avvio);
  if (avvio==1)
     {lcd.print("AUTO");}
  else if (manuale==1)
     {lcd.print("MAN");}
  else if (avvio==0 && manuale==0)
     {lcd.print("SPENTO");}
}
 
void DataOraLCD()
{  
  lcd.setCursor(0,0);
  duecifre2(hour()); lcd.print(':');
  duecifre2(minute());
  lcd.setCursor(6,0);
  lcd.print(DayOfWeek[weekday()-1]);
  lcd.setCursor(10,0);
  duecifre2(day()); lcd.print('/');
  duecifre2(month()); lcd.print('/');
  lcd.print(year());    
}
 
void duecifre2(int digits2) //di richiamo al metodo DataOraLCD
{
  if (digits2 < 10)
     {
       lcd.print("0");
     }
  lcd.print(digits2);
}
 
bool pari() //restituisce un valore booleano, 0 se ora pari, 1 se ora dispari (per ciclo antingelo ogni 2 ore)
{  
  return hour()%2!=0;
}
 
bool consenso()  //restituisce un valore booleano, per dare consenso ad innaffiare all'ora impostata
{
  bool orto=0;
  int innaffio[]={15,15,15,20};// formato ora_avvio,minuti_avvio,ora_arresto,minuti_arresto
  if (innaffio[0]<=hour() && innaffio[2]>=hour() &&innaffio[1]<=minute() && innaffio[3]>=minute())
     {
       orto=1;
     }
  else
     {
       orto=0;
     }
  return orto;
}
 
void visualizza()  // metodo per visualizzare gli stati e I/O su seriale e LCD
  /* La pagina indica la pressione in ectoPascal (hPa), equivalente a 0,001 bar.
   * In atmosfesa tipo (ISA), la pressione al livello del mare è 1013,25 hPa
   * con un gradiente barico verticale 1hPa/27ft, descrescente con la quota
   * in questo modo possiamo determinare quando c'è alta o bassa pressione
   * Usare http://www.onlineconversion.com/pressure.htm per altre unità*/
{
  Serial.print("Altimetro:     "); Serial.print(altitude); Serial.println(" metri");
  Serial.print("Pressione:     "); Serial.print(pressure+2.); Serial.println(" hPa");
  Serial.print("Umidità:       "); Serial.print(hum); Serial.println(" %");
  Serial.print("T° RTC:        "); Serial.print(myRTC.temperature()/4.); Serial.println("°C");
  Serial.print("T° baro:       "); Serial.print(temperatura); Serial.println("°C");
  Serial.print("T° DHT:        "); Serial.print(temp); Serial.println("°C");
  Serial.print("potenziometro: "); Serial.println(valorePotenziometro);
  Serial.print("velocità:      "); Serial.print(map(velocita,0,255,0,100)); Serial.println(" %");
  lcd.setCursor(9,2);
  Serial.print("Stato  :     ");
  if (STATO==0)
     {
       Serial.println("pompa ferma");
       lcd.print("pompa ferma");
     }
  else if (STATO==1)
     {
       Serial.println("riempimento serbatoio");
       lcd.print("riemp serba");
     }
  else if (STATO==2)
     {
       Serial.println("riciclo/antigelo");
       lcd.print("ricic/antig");
     }
  else if (STATO==3)
     {
       Serial.println("irrigazione da pozzo");
       lcd.print("irr.da pozzo");
     }
  else if (STATO==4)
     {
       Serial.println("irrigazione da serbatoio");
       lcd.print("irr.da serb");
     }
  else if (STATO==5)
     {
       Serial.println("irrigazione man da pozzo");
       lcd.print("irr.man.poz");
     }
  Serial.print("Avvio  :     "); Serial.println(avvio);
  Serial.print("Manuale:     "); Serial.println(manuale);
  Serial.print("Pozzo  :     "); Serial.println(lpv);
  Serial.print("Liv min:     "); Serial.println(lsv);
  Serial.print("Liv max:     "); Serial.println(lsp);
  Serial.print("Riciclo:     "); Serial.println(riciclo);  
  Serial.print("Pompa  :     "); Serial.println(pompa);   
  Serial.print("3Vie In:     "); Serial.println(evi);   
  Serial.print("3Vie Us:     "); Serial.println(evu);
  Serial.println();
}
 
void loop()
{  
  avvio = !digitalRead(AVVIO);    //legge interruttore d'avvio e l'associa alla variabile
  manuale = !digitalRead(MANUALE);//inserito selettore: pos.sx=AVVIO; pos.centr=0; pos.dx=MANUALE
  lpv = !digitalRead(LPV);        //legge il sensore di livello pozzo e l'associa alla variabile
  lsv = digitalRead(LSV);         //legge il sensore livello min serbatoio e l'associa alla variabile
  lsp = digitalRead(LSP);         //legge il sensore livello max e l'associa alla variabile
  riciclo = !digitalRead(RICICLO);//legge il pulsante riciclo e l'associa alla variabile
  pompa = digitalRead(POMPA);     //legge l'uscita 'pompa' e l'associa alla variabile
  evi = !digitalRead(EVI);        //legge valvola 3vie ingresso pompa e l'associa alla variabile
  evu = !digitalRead(EVU);        //legge valvola 3vie uscita pompa e l'associa alla variabile
  pressure = (bmp.readPressure()/100.);
  temperatura = bmp.readTemperature();
  altitude = bmp.readAltitude(997.37);
  hum = dht.readHumidity();
  temp = dht.readTemperature();
  // Pressione misurata in ectoPascal hPa
  // Usa http://www.onlineconversion.com/pressure.htm per altre unità  
  valorePotenziometro = analogRead(POTENZIOMETRO);
  velocita = map(valorePotenziometro, 0, 1023, 0, 255);//mappo i valori da 1024 a 255
  DataOraSeriale();
  StatoLCD();
  TempRtcLCD();
  DataOraLCD();
  visualizza();
  if (avvio==1 | manuale==1)
     {digitalWrite (ATTIVO,HIGH);}
  if (millis()%60000==pari())
     {
       InviaDatiSeriale();
     }
  switch(STATO)
  {        
    case 0:  //pompa ferma
    analogWrite (POMPA,0);
    digitalWrite (EVI,HIGH);
    digitalWrite (EVU,HIGH);
    if (avvio==1 && lpv==1 && lsp==0)
       {
         TimeStart=millis();
         STATO=1; // riempi serbatoio     
       }
    else if (manuale==1 && lpv==1)
       {
         TimeStart=millis();      
         STATO=5; // irrigazione manuale da pozzo regolabile
       }   
    else if (riciclo==1 && lsv==1)
       {
         TimeStart=millis();      
         STATO=2; // riciclo/antigelo
       }    
    else if (temperatura<=tempminima && lsv==1 && pari()==0 && minute()==0) 
    // confronta la temperatura restituita dal metodo con la temperatura impostata ed esegue il ciclo ogni ora pari
       {      
         TimeStart=millis();
         STATO=2; // riciclo/antigelo
       }
    else if (consenso()==1 && lpv==1 && avvio==1)  
    // confronta il booleano restituito dal metodo orto per innaffiare all'ora stabilita dal pozzo
       {
         TimeStart=millis();
         STATO=3; // irrigazione da pozzo      
       }
    else if (consenso()==1 && lpv==0 && lsv==1 && avvio==1) 
    // confronta il booleano restituito dal metodo orto per innaffiare all'ora stabilita dal serbatoio
       {
         TimeStart=millis();
         STATO=4; // irrigazione da serbatoio
       }
    else
       {
         STATO=0; // pompa ferma
       }
    break; 
    
    case 1:  //riempimento serbatoio    
    digitalWrite (EVI,HIGH);
    digitalWrite (EVU,HIGH);
    if (millis()-TimeStart>11000) //ritardo per posizionamento valvola 3 vie che qui non c'è
       {
         analogWrite (POMPA,velmax);
         if (avvio==0 || lpv==0 || lsp==1)
         {
            STATO=0;
         }
       }
    break;
    
    case 2: //riciclo - antigelo 
    digitalWrite (EVI,LOW);    
    digitalWrite (EVU,HIGH);
    if (millis()-TimeStart>11000) //ritardo per posizionamento valvola 3 vie
       {
         TimeStop=millis();
         analogWrite (POMPA,velmin);
         if (millis()-TimeStop>50000 || lsv==0); 
            {              
              STATO=0; //pompa ferma
            }
       }      
    break;  
  
    case 3:  //irrigazione da pozzo
    digitalWrite (EVI,HIGH);
    digitalWrite (EVU,LOW);
    if (millis()-TimeStart>11000) //ritardo per posizionamento valvola 3 vie
       {
         analogWrite (POMPA,velmin);
       }
    else if (avvio==0 || lpv==0)
       {
          STATO=0;
       }
    break;
  
    case 4:  //irrigazione da serbatoio
    digitalWrite (EVI,LOW);    
    digitalWrite (EVU,LOW);
    if (millis()-TimeStart>11000) //ritardo per posizionamento valvola 3 vie
       {
         analogWrite (POMPA,velmin);
       }
    else if (avvio==0 || lsv==0)
       {
          STATO=0;
       }
    break;
 
    case 5:  //irrigazione manuale da pozzo regolabile
    digitalWrite (EVI,HIGH);
    digitalWrite (EVU,LOW);
    if (millis()-TimeStart>11000) //ritardo per posizionamento valvola 3 vie
       {
         TimeStop=millis();
         analogWrite (POMPA, velocita);//faccio girare il motore in base alla lettura
         delay (10);
         if (millis()-TimeStop>200000 || lpv==0); 
            {              
              STATO=0; //pompa ferma
            }        
       }
    else if (manuale==0 || lpv==0)
       {
          STATO=0;
       }
    break;
  }
  delay(800);
}
